import React from 'react';

const ListGroup = (props) => {
    const {items}=props;
    return (
        <ul className="list-group mt-6">
            {items.map((item)=> <li key={item._id} className="list-group-item cur">{item.name}</li>)}
        </ul>
    );
};

export default ListGroup;
